from suffix_tree import SuffixTree, SuffixNode


def split_n_insert(current_branch, active_length, i):
    parent_branch = current_branch.parent
    parent_branch.remove_child(current_branch)

    old_start = current_branch.start
    current_branch.start += active_length

    ins_node = SuffixNode(old_start, (old_start + active_length) - 1)

    parent_branch.add_child(ins_node)

    ins_node.add_child(SuffixNode(i))

    ins_node.add_child(current_branch)


def ukkonen(text):
    st = SuffixTree(text)
    active_node = st.root
    # active_letter = ''
    active_length = 0
    remainder = 0

    last_created = None
    suffix_link = {}

    for i in range(st.text_length):
        remainder += 1
        has_created = False
        if active_node.is_root:
            active_letter = st.letter_at((i - remainder) + 1)
        else:
            active_letter = st.letter_at((i - remainder) + 1 + (active_node.end - active_node.start + 1))
        while remainder > 0:
            if active_node.has_child_with_key(active_letter):
                current_branch = active_node.get_child_with_key(active_letter)

                # if the current branch has the next letter
                if st.is_same_letter(current_branch.start + active_length, i):
                    active_length += 1

                    # if the last value of the node is the current value we are on
                    if current_branch.start + active_length - 1 == current_branch.end:
                        active_node = current_branch
                        # active_letter = ''
                        active_length = 0
                    break
                else:

                    if current_branch.end is not None and current_branch.start + active_length > current_branch.end:
                        next_hop = current_branch
                        print('problem')
                        # # TODO rule 3 addendum
                    else:
                        split_n_insert(current_branch, active_length, i)
                    # Splitting stuff
                    # parent_branch = current_branch.parent
                    # parent_branch.remove_child(current_branch)
                    #
                    # old_start = current_branch.start
                    # current_branch.start += active_length
                    #
                    # ins_node = SuffixNode(old_start, (old_start + active_length) - 1)
                    #
                    # parent_branch.add_child(ins_node)
                    #
                    # ins_node.add_child(SuffixNode(i))
                    #
                    # ins_node.add_child(current_branch)

                    remainder -= 1

                    # #Rule 1
                    if active_node.is_root:
                        active_letter = st.letter_at(i - remainder + 1)
                        active_length -= 1

                    # #Rule 3
                    else:

                        if active_node in suffix_link:
                            if suffix_link[active_node].has_child_with_key(active_letter):
                                gathered_length = 0
                                next_hop = suffix_link[active_node]
                                temp_active_letter = active_letter
                                while next_hop.length < active_length:
                                    next_hop = next_hop.get_child_with_key(temp_active_letter)
                                    gathered_length += next_hop.length
                                    # if next_hop.length < active_length:
                                    active_length -= next_hop.length
                                    temp_active_letter = st.letter_at((i - remainder) + 2 + gathered_length)
                                active_node = next_hop
                                active_letter = temp_active_letter
                            else:
                                active_node = suffix_link[active_node]
                        else:
                            active_node = st.root

                        # TODO rule 3 addendum
                        # if active_node.has_child_with_key(active_letter):
                        #     next_hop = active_node.get_child_with_key(active_letter)
                        #     if next_hop.length < active_length:
                        #         active_length -= next_hop.length
                        #         active_letter = st.letter_at((i - remainder) + 2 + (next_hop.end - next_hop.start + 1))
                        #         active_node = next_hop
                    # #Rule 2
                    if has_created:
                        suffix_link[last_created] = current_branch.parent
                    has_created = True
                    last_created = current_branch.parent
            else:
                active_node.add_child(SuffixNode(i))
                remainder -= 1
                if active_node in suffix_link:
                    if suffix_link[active_node].has_child_with_key(active_letter):
                        gathered_length = 0
                        next_hop = suffix_link[active_node]
                        temp_active_letter = active_letter
                        while next_hop.length < active_length:
                            next_hop = next_hop.get_child_with_key(temp_active_letter)
                            gathered_length += next_hop.length
                            # if next_hop.length < active_length:
                            active_length -= next_hop.length
                            temp_active_letter = st.letter_at((i - remainder) + 2 + gathered_length)
                        active_node = next_hop
                        active_letter = temp_active_letter
                    else:
                        active_node = suffix_link[active_node]
                else:
                    active_node = st.root

    st.count_leaves()
    return st


